  ReactDOM.render(


        <h1>
            you clicked on button 
        </h1>


     ,document.getElementById("root")  
  );
}
ReactDOM.render(
  <>
    <div className="btnDiv">
    <button onClick={greet()} className="btn">increment</button>
    </div>
  </>
   ,document.getElementById("root")  
);
